import React, { Component } from 'react';
import BannerIntroduce from '../components/BannerIntrodude.js';
import IntroduceMenu from '../components/IntroduceMenu.js';

export default class Introduce extends Component {
    render(){
        return(
            <div>
                <BannerIntroduce style={{}} />
                <div style={{display: 'flex', justifyContent: 'center'}}>
                    <div style={{paddingTop: 60, width: '84%', display: 'flex'}}>
                        <div style={{display: 'flex', flex: 1}}>
                            <IntroduceMenu style={{}} />
                        </div>
                        <div style={{display: 'flex', flex: 2, flexDirection: 'column'}}>
                            <span style={{fontSize: 32, fontFamily: 'Roboto', fontWeight: 600, color: '#2C2C2C'}}><b>Tổng quan</b></span>
                            <div style={{display: 'flex', flexDirection: 'column'}}>
                                <span style={{fontSize: 15, color: '#373636', fontFamily: 'Roboto', lineHeight: 3}}>Tên công ty: Công ty TNHH Kỹ Thuật SAO MỚI</span>
                                <span style={{fontSize: 15, color: '#373636', fontFamily: 'Roboto'}}>Tên giao dịch: NOVAS Technology Co.,Ltd</span>
                                <span style={{fontSize: 15, color: '#373636', fontFamily: 'Roboto'}}>Tên viết tắt: NOVAS (Name Of Vietnam Advanced Systems - Thương hiệu Việt cho các hệ thống tân tiến)</span>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
        );
    }
}
